class CoHymnsKuendaKwaMukwaYesu {
  static List<HymnsContent> list = [
    HymnsContent(id: 3655, position: 1, content: "Ndotolo ku kuno kwali, \nMukwa kulembejeka; \nMaliji jenyi a vumbi, \nIvwako haliapwila.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_25, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3656, content: "Mwaso uno upema,\nMwaso uno wahiana, \nJina lino lipema, \nYesu, Mwene Yesu.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_25, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3657, position: 2, content: "Makonekena shili ye, \nIvwako liji lienyi; \nMu jila enda ni Mwene, \nMwilu mutwama nenyi.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_25, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3658, position: 3, content: "Mba Vulie! Jina lia Yesu, \nKuvuluka nafwila, \nUlemu weswe twechenu \nKuli mwe Mwana-panga.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_25, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3659, position: 4, content: "Lie Jina lienyi linate, \nKuchinyisa we woma; \nLiahiana majina eswe, \nLie Jina lia kuwaha.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_25, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3660, position: 1, content: "Se tunende nenyi, \nLiji lienyi pangu, \nNi uhenya katutemwina; \nTwapemena Iye; \nKanatwama hamwe, \nTwafuliela, twakwononoka.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_26, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3661, content: "Fulielenu, ni ononokenu, \nHanga twivwe chiseke \nMuli Mwene Yesu.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_26, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3662, position: 2, content: "Nyi chizulie chipwe, \nHanji lelwa limwe, \nKakuhumbulayo chawana, \nSoji ni kuyamba, \nNi wakuhi woma, \nTwafuliela, twakwononoka.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_26, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3663, position: 3, content: "Nyi yilemu yinji, \nNyi yinyengo hashi, \nIye kevwe matwononona; \nNyi luyinda hano, \nMatuwahisaho, \nTwafuliela, twakwononoka.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_26, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3664, position: 4, content: "Twakulishimwinya \nNi kuwahilila, \nMba mutuya hamwe ni  \nMwata, \nChize mamba tute, \nMatutuma tuye, \nTwafuliela, twakwononoka.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_26, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3665, position: 1, content: "Kweswe hamwe ni Yesu hi kawape, \nKweswe mangutetekela hashi te, \nKechi kanguhichika ndo ku songo \nHamwe nenyi kashika kenu mwongo.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_27, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3666, content: "Kweswe, kweswe,  \nWoma kwivwa, ka \nKweswe hamwe ni  \nYesu hikuwaha.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_27, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3667, position: 2, content: "Kweswe te ni Yesu ukawami, ka, \nNo akwetu machina, mba Yesu, ka; \nChipwe mangutwala mu jila yipi, \nHikuwaha wika Yesu ni yami.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_27, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3668, position: 3, content: "Kweswe hamwe ni Yesu kenu yipi, \nMu milima, mu ufuku, mu utoji, \nSe nanyingika mwilu mungunjila, \nMu mahiami ni Yesu mukutwama.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_27, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3669, position: 1, content: "Mwene wetu, tunejila kuno, \nMukulimona meso ni Yena; \nHano ni kwoko lia ufulielo, \nKu vumbi lie twalijikijila.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_28, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3670, position: 2, content: "Hano twafupa kulia ye mbolo, \nChinyingi cha mujimba wa Mwene; \nHano twakwiwuluka ku vinyu, \nManyinga a kujimuna shili.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_28, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3671, position: 3, content: "Shili hi yetu, ululi hi we, \nUhiso wetu, Yena wasamba; \nKashika twakuhwima mbunge pe, \nNi ululi we ni manyinga je.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_28, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3672, position: 4, content: "Kuya tukwete; ha kukatuka, \nYizulie yino kumayichiza; \nAlioze yena hehi wasala. \nLie Tangwa lietu, ni mwe Kafunga.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_28, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3673, position: 1, content: "Chinapeme kufuliela \nMwene Yesu mu jila; \nKuhwima ha liji lienyi, \nKechi katuhichika.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_29, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3674, content: "Mwene Yesu, nafuliela, \nYena Chikwashi chami \nMwene Yesu, weza kama \nKu ufulielo wami.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_29, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3675, position: 2, content: "Chinapeme kufuliela \nKu manyinga a Yesu, \nMumu kanatupemesa \nPundu ku shili yetu.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_29, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3676, position: 3, content: "Chinapeme kufuliela, \nKutambula chawana, \nKuli Iye, Yesu Mwene \nMwono ni sambukila.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_29, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3677, position: 4, content: "Nawaha kumufuliela, \nNgwe kasendo mupema; \nHaliapwa ni yami kwali \nNdo ku songo lia miaka.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_29, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3678, position: 1, content: "Yehova Kafunga kami, \nMba chichi kahona; \nMu kelo kangupombesa, \nKu meya apema.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_30, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3679, position: 2, content: "Kakuhuzulula mbunge, \nNi kakungutwala \nMu majila a ululi, \nMumu Jina lienyi.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_30, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3680, position: 3, content: "Chipwe mu chikulo nawa \nCha kufwa mungwenda, \nHindu chichi kwivwa woma, \nMungulembejeka.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_30, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3681, position: 4, content: "Kumeso já akwa kole \nWalulika mesa; \nUnanguwayisa mutwe, \nMusenge unazala.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_30, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3682, position: 5, content: "Utu ni keke ndo miaka \nMuyikangukaula; \nNi mu zuwo lia Yehova \nMupwe muma mwami.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_30, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3683, position: 1, content: "E, kangutwala kweswe, ngwe \nMaliji jenyi apema pe; \nKweswako yami nakuya, \nNi kwoko lienyi katwala.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_31, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3684, content: "Kangutwala, kangutwala, \nNi kwoko lienyi katwala, \nNgupwe kambaji ka Mwene, \nNi kwoko lienyi atwale.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_31, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3685, position: 2, content: "Yinyengo yinji yipweho, \nChiseke chinji chipweko; \nHindu munguhwima kama, \nNi kwoko lienyi katwala.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_31, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3686, position: 3, content: "Ni kwoko lie ngukwateko, \nNi kanda ngulinyengaho; \nNyi chipi, chipwe chipema, \nNi kwoko lienyi katwala.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_31, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3687, position: 4, content: "Milimo muyikahwako, \nKu vumbi mungukumbaho, \nMba Mwene mwilu kumeza, \nNi kwoko lienyi matwala.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_31, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3688, position: 1, content: "Liwe lia miaka yeswe, \nMuli Yena nguswame; \nMeya ni manyinga je \nAze a ku lumbu lie, \nAnguwuke mu mbunge, \nAngupemese mweswe.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_32, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3689, position: 2, content: "Hi yitanga yami ko \nMangusambisa nayo; \nHi kuzangazanga ko \nHi kulilalila ko. \nYamokomoko yeswe, \nMwene, ungulamwine.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_32, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3690, position: 3, content: "Ni milambu kwecha, ka, \nKu kulusu natala; \nUngujike uzalo we, \nUnguvwile vumbi lie. \nMupi ngukuchinyine, \nUngupemese, Mwene.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_32, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3691, position: 4, content: "Ngunatate kwiza che, \nChipwe kufwa chihete. \nMuze munguya mwilu \nMungukumona, K’Listu, \nLiwe lia miaka yeswe, \nMuli Yena nguswame.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_32, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3692, position: 1, content: "Jina lia Yesu lipema, \nNafwila kulivuluka, \nMumu ngunevu kuwaha, \nJina lia Mwene Yesu.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_33, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3693, content: "Yesu, Jina lipema, \nYesu, tangwa ha tangwa, \nYesu, twambujolenu \nJina lia Mwene Yesu.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_33, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3694, position: 2, content: "Lie Jina lienyi linene, \nMungulivuluka kweswe; \nLia kunguhwimisa wate, \nJina lia Mwene Yesu.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_33, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3695, position: 3, content: "Ngunafwila Jina lienyi, \nLiawahisa mbunge yami; \nLie Jina liahiana eswe, \nJina lia Mwene Yesu.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_33, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3696, position: 4, content: "Akwetu, tuhalisenu \nLie Jina lia Muene wetu; \nMba mutuhalisa mwilu \nJina lia Mwene Yesu.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_33, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3697, position: 1, content: "Zambi apwe hamwe ni yenu, \nNi mu jila anutwale, \nAnukwase yenu eswe; \nZambi apwe hamwe ni yenu.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_34, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3698, content: "Ndo mutuheta, eswe hamwe, \nNdo ku molu já Yesu mwilu; \nNdo mutuheta, eswe hamwe; \nZambi apwe hamwe ni yenu.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_34, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3699, position: 2, content: "Zambi apwe hamwe ni yenu. \nNi mapulwa jenyi Mwene, \nAnufunge, anulise; \nZambi apwe hamwe ni yenu.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_34, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3700, position: 3, content: "Zambi apwe hamwe ni yenu, \nChipwe lamba munumona, \nAnulembejeke kama; \nZambi apwe hamwe ni yenu.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_34, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3701, position: 4, content: "Zambi apwe hamwe ni yenu, \nAnutwamise ni vumbi, \nAnulamwine ku yipi; \nZambi apwe hamwe ni yenu.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_34, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3702, position: 1, content: "Cha kutuwahisa, \nKulikata chetu, \nChize cha kutuwanyisa, \nChili ngwe cha mwilu.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_35, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3703, position: 2, content: "Kumeso já Tata, \nTwakulemba wate; \nMba yipi hanji yipema \nTwakuyivwa hamwe.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_35, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3704, position: 3, content: "Mba twakulikwasa \nSe lamba twakwivwa; \nNyi kachi umwe malila \nEswe twakuchivwa.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_35, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3705, position: 4, content: "Muze mutushika \nNi akwetu hano, \nTunyongenu kuliwana \nMwilu kutwama no.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_35, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3706, position: 1, content: "Vula muwape wa Zambi, \nLino lie liji pundu; \nKumakanoka he hashi \nWa kuli Mwene kwilu.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_36, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3707, content: "Vula muwape, \nVula muwape, ngwenyi, \nWatwaha kamwe kakepe, \nHindu munji twafupa.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_36, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3708, position: 2, content: "Vula muwape wa Zambi, \nAtutumine, Mwene! \nKuhuzuluka tunechi, \nKulita ni Liji lie.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_36, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3709, position: 3, content: "Vula muwape wa Zambi, \nTuma musono uno; \nTunakulembe, Yehova, \nNokesa vula mwilu.", hymnsNumber: CoHymnsNumberSeeder.KUENDA_KWA_MUKWA_YESU_36, typeStanza: HymnsContentCode.VERSE),
  ];
}